import {List} from './style'
import { productContext } from "../../contexts/products"
import { ActionTypes } from '../../pages/Home/Home'
import { useContext } from 'react'

export default function Nav() {

  const {products,setProductsFetched} = useContext(productContext)

  const handleFilter = (category:string)=> {
     if(category === 'All'){
      setProductsFetched({type:ActionTypes.ALL,payload:products})
     }
     else if(category == 'cars') {
      setProductsFetched({type:ActionTypes.CARS,payload:products})
     }
     else if(category == 'biks') {
      setProductsFetched({type:ActionTypes.CARS,payload:products})
     }
  }

  return (
      <>
        <List>
          <li onClick={()=> {handleFilter('All')}}>All</li>
          <li onClick={()=> {handleFilter('cars')}}>Car</li>
          <li onClick={()=> {handleFilter('bike')}}>Bike</li>
        </List>
      </>
  )

}
